import React, { useState } from "react";

import styles from "./PollsBox.module.css";

const PollsBox = () => {
  return (
    <div className={styles.container}>
      <h1>Ballots</h1>
      <div className={styles.ballotsContainer}></div>
    </div>
  );
};

export default PollsBox;
